import React, { forwardRef } from 'react';

const PROJECTS = [
    {
        title: "Commute.nz",
        description: "Hey",
        githubRepo: "yoyo",
    },
    {
        title: "Sameageasmydog.com",
        description: "Ever wondered when you'll be the same age as your dog? Wonder no more!",
        githubRepo: "oh",
    },
    {
        title: "Cheds.club",
        description: "what",
        githubRepo: "Asdas",
    },
]

const Header = forwardRef(({ height }, ref) => (
    <div className="projects" ref={ref} style={{ height }}>
        { PROJECTS.map(project => (
            <div className="project">
                <div className="project__col">
                    <h2>{project.title}</h2>
                    <p>{project.description}</p>
                    <a>{project.githubRepo}</a>
                </div>
                <div className="project__col">
                    {project.title}
                </div>
            </div>
        ))}
    </div>
));

export default Header;
